import pandas as pd
import numpy as np

dtips = pd.read_csv('/tips.csv')
pd.isna(dtips) #verifica se possui NA (not a number) e onde

#Verifica se tem pelo menos 1 NA
np.any(pd.isna(dtips))

#por padrão, a iteração é por linha e precisamos iterar por coluna
print('Dados faltantes em: ')
for (colName, colData) in dtips.iteritems():
  if (np.any(pd.isna(colData))):
    print(colName)

dtips_na_rows = dtips.loc[np.any(dtips.isna(), axis = 1)] #identificar onde estão os dados faltantes
dtips_na_rows

print(dtips.shape)

dtips_na_rows = dtips.dropna()
print(dtips_na_rows.shape)

dtips_na_cols = dtips.dropna(axis=1)
print(dtips_na_cols.shape)

# preencher a posição NA

dtips.loc[np.any(dtips.isna(), axis = 1)]

dtips_fill = dtips.fillna(0)

dtips_fill.loc[np.any(dtips.isna(), axis = 1)]

filldic = {'total_bill':10, 'tips':0}

dtips_fill2 = dtips.fillna(filldic) #preenche os Na de acordo com o dicionario

dtips_fill2.loc[np.any(dtips.isna(), axis=1)] #?? era pra ter substituído

print(dtips.duplicated())

print('\n', dtips.duplicated().any()) #pelo menos uma duplicada

dtips[dtips.duplicated(keep = False)] #retorna true para todas as duplicadas

dtips[dtips.duplicated(keep = 'first')] #mantém a primeira ocorrência que tem duplicidade

dtips[dtips.duplicated(keep = 'last')] #mantém a última ocorrência que tem duplicidade

dtips_first = dtips.drop_duplicates(keep = 'first') #apaga as duplicidades mantendo a primeira

dtips_first = dtips_first.reset_index() #o índice também é removido e precisa ser reiniciado

"""##Preparação de Dados

**3ª Forma normal de Codd**

1. Cada variável forma uma coluna
2. Cada Observação forma uma linha
3. Cada tipo de Unidade Observacional forma uma tabela
"""

import pandas as pd
import numpy as np

"""###Exemplo

Duas tabelas com temperaturas coletadas em cidades. Uma referente ao primeiro e outra ao segundo dia de coleta, organizadas por pessoas diferentes:
"""

#criando os DF

temps = np.array([[23,21,20], [30,29,28], [18,21,20], [9,10,13]])

dtemp0 = pd.DataFrame(temps, index = ['São Paulo', 'Fortaleza', 'Montevideo', 'London'])

dtemp2 = pd.DataFrame({
    'São Paulo' : [25, 27, 23, 25],
    'Fortaleza' : [35, 32, 31, 29],
    'Montevideo' : [20, 18, 21, 23],
    'London' : [14, 15, 12, 13]
})

dtemp0

print(dtemp0.melt())#derrete as colunas (perde a cidade)

#Essa informação está no indice

dtemp0.index

# Recuperar a informação das cidade
dtemp0 = dtemp0.rename_axis('city').reset_index()

dtemp0

#manter a variável cidade como coluna -->  id_vars = ['city']

dtemp0_melt = dtemp0.melt(id_vars = ['city'])
dtemp0_melt

#fazendo mesma coisa, só que armazenando em uma variável e mudando o nome das colunas
table1 = dtemp0.melt(id_vars = ['city'], value_name = 'temperatura', var_name = 'day')
table1

dtemp2

print(dtemp2.melt())#derrete as colunas (perde o dia)

print(dtemp2.melt())

dtemp2.transpose()

dtemp2_tran = dtemp2.transpose().rename_axis('city').reset_index()
dtemp2_tran

#fazendi mesma coisa, só que armazenando em uma variável e mudando o nome das colunas
table2 = dtemp2_tran.melt(id_vars = ['city'], value_name = 'temperatura', var_name = 'day')
table2

"""## Combinando Data Frames"""

import pandas as pd

df1 = pd.DataFrame({'key': ['a','a', 'b', 'b', 'c', 'a'],
                    'data1': range(10,70, 10)})

df2 = pd.DataFrame({'key': ['b', 'a', 'a', 'b'],
                    'data2': range(4)})

print(df1)
print(df2)

pd.merge(df1,df2, on = 'key') #combina todos os df 1 que existe em ambos os df
#quando não tem how, adota o inner como padrão

pd.merge(df1,df2, on = 'key', how = 'outer') # o que não existe nos dois é preenchido como um NaN

